import React, { Fragment, useRef, useCallback } from 'react';

// Components
import HeaderColor from '../header-color';

// Utils
import { COLORS } from '../../utils/colors';

// Styles
import './PageLayout.css';

function PageLayout() {
    const previousColor = useRef();

    const handleClick = useCallback(color => {
        console.log('color', color);
    }, []);

    return (
        <div className={'page-layout'}>
            <section className={'page-layout-colors'}>
                <h3>Colors</h3>
                    { Object.keys(COLORS).map((color, index) =>
                        <Fragment key={index}>
                            <HeaderColor onClick={handleClick} forwardedRef={previousColor} color={color} />
                        </Fragment>
                    )}
            </section>
        </div>
    );
}

export default PageLayout;
